import React from "react";
import styled from "styled-components";

import loginlogo from "media/image/login_logo.png";
import kakaologin from "media/svg/kakao_login.svg";
import login from "media/svg/login.svg";

const Login = () => {
  return (
    <React.Fragment>
      <Wrap>
        <Image />
        <LoginDiv>LOGIN</LoginDiv>
        <EmailInput placeholder="E-mail"></EmailInput>
      </Wrap>
    </React.Fragment>
  );
};

export default Login;

const Wrap = styled.div`
  width: 22rem;
  display: flex;
  flex-direction: column;
  justify-content: center;
  margin: 0px auto;
  font-family: "TTTogether";
`;

const Image = styled.div`
  background-image: url("${loginlogo}");
  background-size: 22rem 18.75rem;
  width: 22rem;
  height: 18.75rem;
`;

const LoginDiv = styled.div`
  display: flex;
  font-size: 1.625rem;
  width: 22rem;
  margin: 0px auto;
  margin-top: 3rem;
  margin-bottom: 3rem;
  justify-content: center;
`;

const EmailInput = styled.input`
  width: 22rem;
  height: 3rem;
  border: 1px solid #707070;
  border-radius: 5px;
  box-shadow: 0px 3px 6px #00000029;
`;
